import styles from "./Global.module.css"

function Global(){
    return (
        <div className={styles.container}>
            <section className={styles.Global}>
                <h2 className={styles.Global__title}>Data Berdasarkan Global </h2>
            </section>
        </div>
    );
}

 export default Global;
